import React from "react";
import "../styles_css/OurWork.css";
const OurWork = () => {
  return (
    <div className="services-grid">
      <div className="service-item">
        <div className="service-content">
          <h3>AI Cloud Solutions</h3>
          <p>Protecht</p>
          <img src="" alt="Protecht Logo" className="company-logo" />
          <p>reYa.cloud | Supported by Protecht.ch</p>
          <button className="service-btn">See projects</button>
        </div>
        <img src="" alt="AI Cloud Solutions" className="service-image" />
      </div>

      <div className="service-item">
        <div className="service-content">
          <h3>Blockchain</h3>
          <p>Protecht</p>
          <img src="" alt="Protecht Logo" className="company-logo" />
          <p>DApp and Wallet Development for Blockchain Solutions</p>
          <button className="service-btn">See projects</button>
        </div>
        <img src="" alt="Blockchain Solutions" className="service-image" />
      </div>

      {/* Add more service items as needed */}
    </div>
  );
};

export default OurWork;
